import React from 'react'

const Contador = () => {
  return (
    <nav>
      <button className='btn btn-lg btn-primary'> + </button>
      <button className='btn'> +5 </button>
      <button className='btn'> 0 </button>
      <button className='btn'> - </button>
      <button className='btn'> -5 </button>
    </nav>
  )
}

export default Contador
